import { Card, FormGroup, IconButton, Typography } from '@material-ui/core'
import { MoreHoriz } from '@material-ui/icons'
import React from 'react'

import imag4 from '../resurces/imag4.png'

export function ListCards({ card }) {
  return (
    <>
      {card.map((e, i) => (
        <Card key={i} sx={{ mb: 2, width: '78%', ml: 2 }}>
          <FormGroup row>
            <img
              src={imag4}
              alt=''
              style={{
                width: '100px',
                height: '100px',
                margin: '10px',
              }}
            />
            <div>
              <Typography variant='subtitle1' sx={{ mt: 1 }}>
                {e.title}
              </Typography>
              <div style={{ display: 'flex' }}>
                {e.type === 'release' && (
                  <Typography
                    variant='body1'
                    sx={{ fontSize: 14, backgroundColor: 'blue' }}
                  >
                    {e.type}
                  </Typography>
                )}
                {e.type === 'event' && (
                  <Typography
                    variant='body1'
                    sx={{ fontSize: 14, backgroundColor: 'red' }}
                  >
                    {e.type}
                  </Typography>
                )}
                <Typography variant='body1' sx={{ fontSize: 14, ml: 1 }}>
                  {e.date}
                </Typography>
              </div>
              <Typography varient='body2'>{e.description}</Typography>
            </div>
            <IconButton
              size='small'
              sx={{ backgroundColor: 'cdcdcd', width: 30 }}
            >
              <MoreHoriz sx={{ fontSize: 15 }} />
            </IconButton>
          </FormGroup>
        </Card>
      ))}
    </>
  )
}
